import React from 'react'
import './Items.css';
// import all_products from '../Assets/All_products';

function Items(props) {
  return (
    <div className='item'>
          <img src={props.image}/>  
          <p>{props.name}</p>
            <div className='items-prices'>
          <div className='item-prices-new'>
             {props.new_price}
          </div>

          <div className='item-price-old'>
             {props.old_price}
          </div>

            </div>
    </div>
  )
}

export default Items;
